import React from "react";
import { Doughnut } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";

ChartJS.register(ArcElement, Tooltip, Legend);

const DoubleDoughnutChart = () => {
  const innerData = {
    labels: ["A", "B", "C", "D"],
    datasets: [
      {
        data: [10, 20, 30, 40],
        backgroundColor: ["#00b4b0", "#338fff", "#ec63ff", "#732fff"],
        borderWidth: 2,
      },
    ],
  };

  const outerData = {
    labels: ["E", "F", "G", "H", "I", "J"],
    datasets: [
      {
        data: [10, 10, 10, 10, 10, 10],
        backgroundColor: [
          "#732fff",
          "#0020b0",
          "#00b4b0",
          "#338fff",
          "#0020b0",
          "#ec63ff",
        ],
        borderWidth: 2,
      },
    ],
  };

  return (
    <div style={{ position: "relative", width: "300px", height: "300px" }}>
      <Doughnut data={innerData} options={{ cutout: "50%" }} />
      <div
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
        }}
      >
        <Doughnut data={outerData} options={{ cutout: "80%" }} />
      </div>
    </div>
  );
};

export default DoubleDoughnutChart;
